
import numpy as np

def shortestPalindrome(s):
    # O(n_sq), this can be done in very less time bu keeping a count of consequtive numbers that are same.
    st1 = list(s)
    str2 = [i for i in reversed(st1)]
    
    nw_j = 0
    arr_ = []
    while True:
        j = nw_j
        flag = 0
        for i_val in st1:

            if j == len(str2):
                break

            # print('j_val ', j)
            # print('vals: ', i_val, str2[j])

            if i_val == str2[j]:
                j += 1
            else:
                flag = 1
                break

        if flag == 1:
            arr_.append(str2[nw_j])

        # print(arr_)
        nw_j = nw_j + 1

        if flag == 0:
            break
    return (''.join(arr_+st1))
            

print(shortestPalindrome(''))

